import React from 'react';

const productList = [
  {
    id: 1,
    name: 'Sword Tail',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://www.petguide.com/wp-content/uploads/2013/11/swordtail-fish.jpg'
  }
];
const products = () => {
    return (
      <div>
      {/* Header */}
      <nav class="navbar navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand">DO AQUA FISHES</a>
          <form class="d-flex">
            <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
            <button class="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </nav>
      {/* List of products */}
      <h2>Products</h2>
      {
        productList.map((prod))
      }
      </div>

    );
};


export default products;
